                </div>

                <div class="col-sm-6" >
                    <div class="form-group">
                        <label class="form-label" for="date_paid">Role</label>
                        <label class="hint form-label" for="first_name">Current Role - {userdetail.user_role} </label>
                        <select  id='update_role' class="form-control"> 
